import React from 'react';
import ReactDOM from 'react-dom';
import 'fontsource-roboto';
import { Button, Container } from '@material-ui/core';

const App = () => {
  return (
    <Container>
      <Button>Yo</Button>
    </Container>
  );
}

ReactDOM.render(<App />, document.querySelector('#app'));

export default App;
